import './App.css';
import Header from "./components/Header/Header";
import Footer from "./components/Footer/Footer";
import AntiqueTable from './components/ATable/AntiqueTable';

const emptyDefaultList = {
  name:"",
  category:"",
  value:"",
  material:"",
  color:"",
  style:"",
  brand:"",
  model:"",
  timePeriod:"",
  condition:"",
  origin:"",
  purpose:"",
  owner:"",
  history:"",
  size:"",
  comment:"",
}

function App() {
  return (
    <div>
      <Header />
      <AntiqueTable antiques={emptyDefaultList}/>
      <Footer />

    </div>
  );
}

export default App;
